message:
“Feitos” do governo vermelho em 15 dias

01 - Aumento de impostos

02 - Aumento de taxas no Detran

03 - Aumento de impostos para aposentados

04 - Devolução do auxilio emergencial;

05 - Fim do saque aniversário do FGTS;

06 - Promessa de isenção de imposto de renda pra quem ganha até 5 mil reais, mas vai sugar dinheiro até de quem ganha 1 salário e meio;

07 - Acabou com o ensino para cegos e surdos;

08 - Acabou com a secretaria de alfabetização;

09 - Vai voltar a financiar obras em ditaduras com nossos impostos;

10 - Isenção do ICMS acabará em 2 meses.

11 - Aumentou o salário dos Ministros do $TF em 18%.

12 - Abaixou o salário mínimo de 1320 para 1302.

13 - Criou 14 novos ministérios.

14 - Invasão à residência com mão armada não dará cadeia.

15 - Vai processar quem reclamar do governo.

16 - Passou 2022 falando em fome, mas vai investir 10 bi na Cultura e só 1 bi no Agro

17 - Vetou ensino de Informática, Programação e Robótica no Ensino Público.

Quer estar conectado com as notícias do Brasil e do mundo? Se inscreva! 👇🏻
https://t.me/+sIzajq1LEe04OWQx

*Prezado Sr.(a) Senador (a)*
Venho por meio deste e-mail manifestar minha opção de voto ao Senador Rogério Marinho para ocupar a Mesa Diretora do Senado.
O referido senador possui maiores chances de vitória  para recuperar a confiança do povo a essa casa legislativa que tem sido desrespeitada pelo Poder Judiciário e “recuperar a independência” do Senado diante do STF
O  Sen. Rodrigo Pacheco omitiu-se diante dos inúmeros pedidos de impeachment contra Ministros do STF sob acusação de quebra da independência, harmonia e interferências indevidas  nos demais poderes constitucionais, além de violações ao devido processo legal que restringiram liberdades, direitos e garantias constitucionais. 
Como integrante do povo evoco o poder constituinte contido no parágrafo único do Art. 1º da CF/88 e exijo o FIM DO VOTO SECRETO E O VOTO ABERTO PARA ELEIÇÃO DE PRESIDÊNCIA DO SENADO.
